-- Name: FUNCTION atualizar_estatisticas_campanha(p_id_campanha uuid); Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON FUNCTION public.atualizar_estatisticas_campanha(p_id_campanha uuid) IS 'Atualiza estatsticas de envio da campanha baseado nos destinatrios';


