--

COMMENT ON FUNCTION public.criar_lembretes_agendamento(p_id_empresa uuid, p_id_agendamento uuid, p_id_paciente uuid, p_dt_agendamento timestamp without time zone) IS 'Cria lembretes automticos (24h e 2h) para um agendamento';


