COMMENT ON COLUMN public.tb_usage_metrics.nm_metric_type IS 'Tipo de mtrica: api_calls, tokens, messages, agents, etc';


--
-- Name: COLUMN tb_usage_metrics.nr_value; Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON COLUMN public.tb_usage_metrics.nr_value IS 'Valor numrico da mtrica (pode ser decimal para GB, etc)';


--
-- Name: COLUMN tb_usage_metrics.dt_period_start; Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON COLUMN public.tb_usage_metrics.dt_period_start IS 'Incio do perodo de medio';


--
-- Name: COLUMN tb_usage_metrics.dt_period_end; Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON COLUMN public.tb_usage_metrics.dt_period_end IS 'Fim do perodo de medio';


